import styles from './components/Pages/App.module.css';
import MyButton from './components/UI/button/MyButton';
import BiographyPage from './components/Pages/BiographyPage';
import PorfolioPage from './components/Pages/PortfolioPage';
import ResumephyPage from './components/Pages/ResumePage';
import VideoPage from './components/Pages/VideoPage';
import ContactsPage from './components/Pages/ContactsPage';
import MainPage from './components/Pages/MainPage';
import {
  BrowserRouter,
  Routes,
  Route,
  Navigate,
  NavLink,
} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <div className={styles.App}>
        <div className={styles.navigation}>
          <NavLink to="/main" className={styles.linkButton}>
            <MyButton>Главная</MyButton>
          </NavLink>
          <NavLink to="/biography" className={styles.linkButton}>
            <MyButton>Биография</MyButton>
          </NavLink>
          <NavLink to="/portfolio" className={styles.linkButton}>
            <MyButton>Портфолио</MyButton>
          </NavLink>
          <NavLink to="/resume" className={styles.linkButton}>
            <MyButton>Резюме</MyButton>
          </NavLink>
          <NavLink to="/video" className={styles.linkButton}>
            <MyButton>Видео</MyButton>
          </NavLink>
          <NavLink to="/contacts" className={styles.linkButton}>
            <MyButton>Контакты</MyButton>
          </NavLink>
        </div>
        <Routes>
          <Route path="/" exact element={<Navigate to="/main" />} />
          <Route path="/main" element={<MainPage />} />
          <Route path="/biography" element={<BiographyPage />} />
          <Route path="/portfolio" element={<PorfolioPage />} />
          <Route path="/resume" element={<ResumephyPage />} />
          <Route path="/video" element={<VideoPage />} />
          <Route path="/contacts" element={<ContactsPage />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
